import { Plugin, PluginSettingTab, Setting } from "obsidian";

interface SitelenPonaSettings {
	enableCodeBlock: boolean;
	enableInline: boolean;
	latinToSitelenFont: string;
	ucsurFont: string;
}

const DEFAULT_SETTINGS: SitelenPonaSettings = {
	enableCodeBlock: true,
	enableInline: true,
	latinToSitelenFont: "", // Default to empty string
	ucsurFont: "linja-sike",
};

export default class SitelenPonaPlugin extends Plugin {
	settings: SitelenPonaSettings;

	async onload() {
		await this.loadSettings();
		this.addSettingTab(new SitelenPonaSettingTab(this.app, this));
		await this.updateFontStyles();

		if (this.settings.enableCodeBlock) {
			this.registerMarkdownCodeBlockProcessor(
				"sitelenpona",
				(source, el, ctx) => {
					const glyphsContainer = document.createElement("div");
					glyphsContainer.classList.add("sitelen-pona-latin");
					glyphsContainer.innerText = source;
					el.appendChild(glyphsContainer);
				}
			);
		}

		if (this.settings.enableInline) {
			this.registerMarkdownPostProcessor((el, ctx) => {
				const elements = el.querySelectorAll("p, li");

				elements.forEach((element) => {
					element.innerHTML = element.innerHTML.replace(
						/(?:u)?\/([^\/]+)\//gs,
						(match, text, offset, string) => {
							const isUCSUR = string[offset] === "u";
							const container = document.createElement("span");
							container.classList.add(
								isUCSUR
									? "sitelen-pona-ucsur"
									: "sitelen-pona-latin"
							);
							const lines = text.split("\n");
							lines.forEach((line, index) => {
								line = line.replace(/<br>/g, "");
								if (index > 0) {
									container.appendChild(
										document.createElement("br")
									);
								}
								const textNode = document.createTextNode(line);
								container.appendChild(textNode);
							});
							return container.outerHTML;
						}
					);
				});
			});
		}
	}

	async updateFontStyles() {
		const existingStyle = document.getElementById('sitelen-pona-styles');
		if (existingStyle) {
			existingStyle.remove();
		}

		const style = document.createElement("style");
		style.id = 'sitelen-pona-styles';
		
		let latinToSitelenFontFace = '';

		if (this.settings.latinToSitelenFont === '') {
			const base64Font = this.getBase64Font();
			
			if (base64Font.length === 0) {
				return;
			}

			try {
				atob(base64Font);
			} catch (e) {
				return;
			}

			try {
				const fontFace = new FontFace('linja-pona', `url(data:font/otf;base64,${base64Font})`);
				const loadedFont = await fontFace.load();
				document.fonts.add(loadedFont);
			} catch (error) {
				return;
			}

			latinToSitelenFontFace = `
				@font-face {
					font-family: 'linja-pona';
					src: url(data:font/otf;base64,${base64Font}) format('opentype');
				}
				.sitelen-pona-latin {
					font-family: 'linja-pona', sans-serif;
				}
			`;
		} else {
			latinToSitelenFontFace = `
				.sitelen-pona-latin {
					font-family: '${this.settings.latinToSitelenFont}', sans-serif;
				}
			`;
		}

		const fullStyleContent = `
			${latinToSitelenFontFace}
			.sitelen-pona-ucsur {
				font-family: '${this.settings.ucsurFont}', sans-serif;
			}
		`;

		style.textContent = fullStyleContent;
		document.head.appendChild(style);
	}

	async loadSettings() {
		this.settings = Object.assign(
			{},
			DEFAULT_SETTINGS,
			await this.loadData()
		);
	}

	async saveSettings() {
		await this.saveData(this.settings);
		this.updateFontStyles(); // Update styles when settings change
	}

	escapeHtml(unsafe: string): string {
		return unsafe
			.replace(/&/g, "&amp;")
			.replace(/</g, "&lt;")
			.replace(/>/g, "&gt;")
			.replace(/"/g, "&quot;")
			.replace(/'/g, "&#039;");
	}

	onunload() {
		console.log("Unloading Sitelen Pona Plugin");
	}

	getBase64Font(): string {
		return ``;
	}
}

class SitelenPonaSettingTab extends PluginSettingTab {
	plugin: SitelenPonaPlugin;

	constructor(app: any, plugin: SitelenPonaPlugin) {
		super(app, plugin);
		this.plugin = plugin;
	}

	display(): void {
		const { containerEl } = this;

		containerEl.empty();

		containerEl.createEl("h2", { text: "Sitelen Pona Plugin Settings" });

		// Setting for enabling/disabling code block rendering
		new Setting(containerEl)
			.setName("Enable Code Block Rendering")
			.setDesc(
				"Enable rendering of code blocks labeled as `sitelenpona`."
			)
			.addToggle((toggle) =>
				toggle
					.setValue(this.plugin.settings.enableCodeBlock)
					.onChange(async (value) => {
						this.plugin.settings.enableCodeBlock = value;
						await this.plugin.saveSettings();
					})
			);

		// Setting for enabling/disabling inline rendering
		new Setting(containerEl)
			.setName("Enable Inline Rendering")
			.setDesc(
				"Enable rendering of text enclosed in `/.../` as sitelen pona."
			)
			.addToggle((toggle) =>
				toggle
					.setValue(this.plugin.settings.enableInline)
					.onChange(async (value) => {
						this.plugin.settings.enableInline = value;
						await this.plugin.saveSettings();
					})
			);

		// Setting for Latin to Sitelen Pona font
		new Setting(containerEl)
			.setName("Latin to Sitelen Pona Font")
			.setDesc(
				"Enter the name of the font for converting Latin text to sitelen pona. Leave blank for default."
			)
			.addText((text) =>
				text
					.setPlaceholder("Enter font name")
					.setValue(this.plugin.settings.latinToSitelenFont)
					.onChange(async (value) => {
						this.plugin.settings.latinToSitelenFont = value;
						await this.plugin.saveSettings();
					})
			);

		// Setting for UCSUR font
		new Setting(containerEl)
			.setName("UCSUR Font")
			.setDesc(
				"Select the font for UCSUR (proposed Unicode sitelen pona)."
			)
			.addText((text) =>
				text
					.setPlaceholder("Enter font name")
					.setValue(this.plugin.settings.ucsurFont)
					.onChange(async (value) => {
						this.plugin.settings.ucsurFont = value;
						await this.plugin.saveSettings();
					})
			);
	}
}
